import { useEffect, useState } from "react";

/* ===== MAP PARAMS ===== */
const GRID_SIZE = 40;
const MAP_SIZE = 800;
const GRID_COUNT = MAP_SIZE / GRID_SIZE;

/* ===== MAIN ===== */
export default function App() {
  const [mode, setMode] = useState("place"); // place | object
  const [gridMap, setGridMap] = useState({});

  /* ===== JSON LOAD (site open) ===== */
  useEffect(() => {
    fetch("/semantic_grid_map.json")
      .then((res) => {
        if (!res.ok) return;
        return res.json();
      })
      .then((data) => {
        if (data && data.grid) {
          setGridMap(data.grid);
        }
      })
      .catch(() => {
        console.log("no existing json");
      });
  }, []);

  /* ===== GRID CLICK ===== */
  const handleGridClick = (gx, gy) => {
    const key = `${gx},${gy}`;

    if (mode === "place") {
      const place = prompt("place name?");
      if (!place) return;

      setGridMap((prev) => ({
        ...prev,
        [key]: {
          place,
          objects: prev[key]?.objects || []
        }
      }));
    }

    if (mode === "object") {
      if (!gridMap[key]) {
        alert("place 먼저 지정해야 함");
        return;
      }

      const id = prompt("object id?");
      const type = prompt("object type?");
      if (!id || !type) return;

      setGridMap((prev) => ({
        ...prev,
        [key]: {
          ...prev[key],
          objects: [...prev[key].objects, { id, type }]
        }
      }));
    }
  };

  /* ===== JSON SAVE ===== */
  const saveJSON = () => {
    const blob = new Blob(
      [JSON.stringify({ grid: gridMap }, null, 2)],
      { type: "application/json" }
    );

    const url = URL.createObjectURL(blob);
    const a = document.createElement("a");
    a.href = url;
    a.download = "semantic_grid_map.json";
    a.click();
    URL.revokeObjectURL(url);
  };

  return (
    <div style={{ display: "flex" }}>
      {/* MAP */}
      <div
        style={{
          width: MAP_SIZE,
          height: MAP_SIZE,
          backgroundImage: "url('/map.png')",
          backgroundSize: "cover",
          position: "relative",
          border: "1px solid black"
        }}
        onClick={(e) => {
          const rect = e.currentTarget.getBoundingClientRect();
          const px = e.clientX - rect.left;
          const py = e.clientY - rect.top;
          const gx = Math.floor(px / GRID_SIZE);
          const gy = Math.floor(py / GRID_SIZE);
          handleGridClick(gx, gy);
        }}
      >
        {/* grid lines */}
        {[...Array(GRID_COUNT)].map((_, i) => (
          <div key={`v${i}`} style={{
            position: "absolute",
            left: i * GRID_SIZE,
            top: 0,
            width: 1,
            height: "100%",
            background: "rgba(0,0,0,0.2)"
          }} />
        ))}
        {[...Array(GRID_COUNT)].map((_, i) => (
          <div key={`h${i}`} style={{
            position: "absolute",
            top: i * GRID_SIZE,
            left: 0,
            height: 1,
            width: "100%",
            background: "rgba(0,0,0,0.2)"
          }} />
        ))}

        {/* place visualization */}
        {Object.entries(gridMap).map(([key, val]) => {
          const [gx, gy] = key.split(",").map(Number);
          return (
            <div
              key={key}
              style={{
                position: "absolute",
                left: gx * GRID_SIZE,
                top: gy * GRID_SIZE,
                width: GRID_SIZE,
                height: GRID_SIZE,
                background: "rgba(0,255,0,0.25)"
              }}
              title={val.place}
            />
          );
        })}
      </div>

      {/* PANEL */}
      <div style={{ marginLeft: 20, width: 450 }}>
        <h3>Mode</h3>
        <button onClick={() => setMode("place")}>Place</button>
        <button onClick={() => setMode("object")}>Object</button>
        <button onClick={saveJSON}>Save JSON</button>

        <h3>Semantic Grid JSON</h3>
        <pre style={{ height: 600, overflow: "auto" }}>
{JSON.stringify({ grid: gridMap }, null, 2)}
        </pre>
      </div>
    </div>
  );
}
